import React from 'react';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import { Dropdown } from 'semantic-ui-react';
import { logout } from '../../actions/auth';

const Navbar = ({ logout }) => {
  const exerciseMenu = [
    { key: 'list', text: 'Exercise List', value: '/exercises' },
    { key: 'add', text: 'Add Exercise', value: '/add-exercise' },
    // { key: 'edit', text: 'Edit Exercise', value: '/edit-exercise?:id' },
  ];

  const clientMenu = [
    { key: 'add', text: 'Add Client', value: '/add' }
  ];
  const trigger = (
    <span style={ { marginTop: "2px" } }>
      <i aria-hidden="true" class="user big icon" size="big" />
    </span>
  );

  return (
    <nav className="navbar">
      <ul>
        <li>
          <Link to="/exercises">
            <span>EXERCISE LIST</span>
          </Link>
        </li>
        <li>
          <Link to="/add-exercise">
            <span>ADD EXERCISE</span>
          </Link>
        </li>
        <li>
          <Link to="/dashboard">
            <span>CLIENTS</span>
          </Link>
        </li>
        <li>
          <Link to="/add">
            <span>ADD A CLIENT</span>
          </Link>
        </li>
        <li><Link onClick={ logout } to="/">
          <span>LOGOUT</span>
        </Link>
        </li>
      </ul>

    </nav>
    // <Dropdown trigger={ trigger } pointing='top left' icon={ null }>
    //   <Dropdown.Menu text="Exercises"  >
    //     <Dropdown.Item text='Exercise List' as={ Link } to='/exercises' />
    //     <Dropdown.Item />
    //   </Dropdown.Menu>
    //   <Dropdown.Menu>
    //     <Dropdown.Item />
    //   </Dropdown.Menu>
    //   <Dropdown.Menu></Dropdown.Menu>
    // </Dropdown>
  );
};
Navbar.propTypes = {
  logout: PropTypes.func.isRequired,
};

export default connect(null, { logout })(Navbar);
